import React,{useState,useEffect} from 'react'


const Display = () => {
    
    const [displays , setDisplays]=useState([]);
    const getData=async()=>{
        try {
            const data= await fetch("/userinput")

            console.log(data);
            setDisplays(data);
        } catch (error) {
            console.log(error)
        }
    }
    
    useEffect(() => {
        getData();
    }, [])
    return (
        <div>
            <h1>Display</h1>
            {displays.map(item=>{
                return <p>{item.data}</p>
            })}
        </div>
    )
}

export default Display
